import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HomePage from './Pages/HomePage';
import AboutPage from './Pages/AboutPage';
import ContactPage from './Pages/ContactPage';
import reportWebVitals from './reportWebVitals';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Login from '../src/Pages/LoginPage';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>

      <Routes>
        <Route exact path="/" element={<HomePage />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/contact" element={<ContactPage />} />
        <Route path="/login" element={<Login/>} />
        <Route path="*" element={<h1>Page Not Found</h1>} />
      </Routes>

    </BrowserRouter>

    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.3/css/all.min.css" integrity="sha512-r7ZrLrMg0U9TWqM6OaH0+AMQHoT//n+q3TJdPS7lS2x20Rc7XuG+4eV7s63P4e8LwNgLZvz+wZtqcSMJIfayQ==" crossorigin="anonymous" referrerpolicy="no-referrer" />

  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
